import React, { Component } from 'react'

class Controlledcompont extends Component {
    constructor(props){
        super(props);
        this.state = {
            name:"disha",
        };
    }
  render() {
    return (
      <div>
        <form>
            <input type="text" name="u_input" value={this.state.name} />
        </form>
      </div>
    )
  }
}

export default Controlledcompont;
